import FiltroNumerico from './FiltrosTabela';

class Headers extends React.Component {
  render() {
    return (
      <div>
        <div>
          <FiltroNumerico />
        </div>
        <thead>
          <tr>
            <td>{name}</td>
            <td>{rotation_period}</td>
            <td>{orbital_period}</td>
            <td>{diameter}</td>
            <td>{climate}</td>
            <td>{gravity}</td>
            <td>{terrain}</td>
            <td>{planet.surface_water}</td>
            <td>{planet.population}</td>
            <td>{planet.films}</td>
            <td>{planet.created}</td>
            <td>{planet.edited}</td>
            <td>{planet.url}</td>
          </tr>
        </thead>
      </div>
    );
  }
}

export default Headers;
